import React from "react";
// import { Parallax } from "react-scroll-parallax";
import {
  ContactContainer,
  ContactInner,
  ContactEmail,
  ContactLinkedIn,
  ContactInstagram,
  Image,
} from "./ContactElements";
import Daruma from "../../images/Daruma.png";

const Contact = () => {
  return (
    <ContactContainer id="contact">
      <ContactInner>
        <ContactEmail><Text></Text></ContactEmail>
        <ContactLinkedIn><Text></Text></ContactLinkedIn>
        <ContactInstagram><Text></Text></ContactInstagram>
      </ContactInner>
    </ContactContainer>
  );
};

export default Contact;
